r($,"bg0","aJL",()=>{var q="DescriptionJob-FR",p="DescriptionJob-EN",o="Lead Game Developper",n="As a Lead Game Developper, I was in charge of technical questions, deadlines in the whole team, technical feasibility and the progress of my own tasks.",m="IIM Digital School",l="Gameplay Developper",k="assets/NoteIt/1.png",j="assets/PokemonLike/1.JPG",i="assets/ZeldaLike/3.png",h=t.s,g=t.N,f=t.z
return A.S(["GameEngine",A.S(["Name","Game Engine","Key","GameEngine","Job","Tools Programmer","Skills",A.a(["Vulkan","C++"],h),"GameType",A.a(["Engine"],h),"Tasks-FR",A.a(["Int\xe9grer GLFW pour faire la window","D\xe9couvrir comment les api graphiques fonctionnent (pipeline, swapchain, etc...)","Setup Vulkan en cpp pour faire le Hello World (Triangle)","D\xe9couvrir comment utiliser Renderdoc pour le moteur, pour voir si quelque chose ne va pas bien et l'optimisation","Int\xe9gration des textures pour Vulkan et Dear ImGui","Cr\xe9ations d'interfaces sur ImGui : - Hiearchy (voir, delete, copier des sc\xe8ne et objets. Voir les objets dans la sc\xe8ne) \n- Inspecteur (Position / Rotation, Scale avec linked option, Couleur, Nom, Description, Texture view et change) \n- Console (Afficher des messsages, diff\xe9rentes couleurs, filtrer les logs (log, warning, error)) \n- File Explorer (Afficher les dossiers et fichiers, trier avec des filtres, ajouter des textures avec aussi option file picker de windows)"],h),"Tasks-EN",A.a(["Integrate GLFW to create the window","Learn how graphics APIs work (pipeline, swapchain, etc...)",'Set up Vulkan in C++ to display a "Hello World" (Triangle).',"Explore how to use Renderdoc with the engine to identify issues and optimize performance","Integrate textures for Vulkan and Dear ImGui","Create interfaces in ImGui: - Hierarchy: view, delete, and copy scenes and objects; view objects within a scene - Inspector: adjust Position, Rotation, Scale (with linked option), Color, Name, Description, Texture view and change - Console: display messages with different colors, filter logs by type (log, warning, error) - File Explorer: view folders and files, sort with filters, add textures, including a file picker option from Windows"],h),q,"En tant que Tools Programmer, j'\xe9tais charg\xe9 de la bonne int\xe9grationde Vulkan, des textures pour Vulkan et Dear ImGui, des interfaces avec Dear ImGui. J'ai d\xfb comprendre comment utiliser les api graphique et d'autres outils li\xe9s",p,"As a Tools Programmer, I was in charge of the good integration of Vulkan, textures for Vulkan and Dear ImGui, interfaces with Dear ImGui. I has to understand how graphic apis works and other related tools ","NumPersonnes",8,"NumSemaines",5,"Location","Gaming Campus","Importance",0,"Story-EN","An-Gine is a game engine make by 8 people in 5 weeks. It's a game engine that uses Vulkan for the rendering, and Dear ImGui for the interface. It's a project that was made to learn how to make a game engine, and to learn how to use Vulkan with C++.","Story-FR","An-Gine est un moteur de jeu fait par 8 personnes en 5 semaines. C'est un moteur de jeu qui utilise Vulkan pour le rendu, et Dear ImGui pour l'interface. C'est un projet qui a \xe9t\xe9 fait pour apprendre \xe0 faire un moteur de jeu, et pour apprendre \xe0 utiliser Vulkan avec C++.","Image","./assets/GamesPhotos/gameengine.png","LinkGithub","https://github.com/Cookiezikse/An-Gine-Self"],g,f),"LoopOut",A.S(["Key","LoopOut","Name","Loop Out","Job",o,"Type","Vertical Slice","Skills",A.a(["Godot","C#"],h),"GameType",A.a(["Puzzle"],h),"Tasks-FR",A.a(["Leadership, voir que tout le monde travail et mettre \xe0 jour tout le monde sur l\u2019avancement du projet","Coder toutes les m\xe9caniques de puzzle game","Trailer du jeu, post linkedin, page itch.io","Easter egg : fin alternative et jeux bonus"],h),"Tasks-EN",A.a(["Leadership, see that everyone works and update everyone on the progress of the project","Code all the mechanics of the puzzle game","Trailer of the game, post linkedin, itch.io page","Easter egg: alternative ending and bonus games"],h),q,"En tant que Lead Game Developper, j'\xe9tais charg\xe9 des questions niveau technique, du respect des d\xe9lais dans toute l'\xe9quipe, de la faisabilit\xe9 c\xf4t\xe9 technique et de l'avancement de mes propres t\xe2ches.",p,n,"NumPersonnes",5,"NumSemaines",4,"Location","Gaming Campus","Importance",0,"Image","./assets/GamesPhotos/loopout.png","Story-EN","Loop-Out is a third-person game in which the player takes on the role of an employee of Godot Industrie and must discover his environment and solve a multitude of puzzles in order to repair and correct the interference of the portal present in the map and thus exit the level. \nIt takes place in a futuristic universe where space-time travel exists. A station has just called the company where the player works, and he's on his way to repair the portal. Being new to the job, the player will be surprised by the various causes of interference, and will have to teach himself how to solve the various problems.","Story-FR","Loop-Out est un jeu \xe0 la troisi\xe8me personne dans lequel le joueur, un employ\xe9 de Godot Industrie, doit d\xe9couvrir son environnement et r\xe9soudre une multitude d'\xe9nigmes afin de r\xe9parer et corriger les interf\xe9rences du portail pr\xe9sent dans la map et ainsi sortir du niveau. \nIl se d\xe9roule dans un univers futuriste o\xf9 les voyages spatio-temporels existent. Une station vient d'appeler l'entreprise o\xf9 travaille le joueur, et il est en route pour r\xe9parer le portail. \xc9tant nouveau dans le m\xe9tier, le joueur sera surpris par les diff\xe9rentes causes d'interf\xe9rences, et devra s'auto-former pour r\xe9soudre les diff\xe9rents probl\xe8mes.","LinkItchIo","https://cookiekrips.itch.io/loopout","ItchIoEmbed",'<iframe frameborder="0" src="https://itch.io/embed/2436441?border_width=0&amp;bg_color=ffffff" width="550" height="165"><a href="https://cookiekrips.itch.io/loopout">LoopOut by CookieKrips, Draknut, Catchow</a></iframe>',"Images",A.a(["assets/LoopOut/1.png","assets/LoopOut/2.png","assets/LoopOut/3.png","assets/LoopOut/4.png"],h)],g,f),"DontLookAway",A.S(["Key","DontLookAway","Name","Don't Look Away","Job","Game Developper","Type","Gamejam","Skills",A.a(["Unity","C#"],h),"GameType",A.a(["Horror"],h),"Tasks-FR",A.a(["Programmation des IA avec des States (diff\xe9rents comportements) et Pathfinding A*. Programmation de 3 IA avec chacun des comportements diff\xe9rents","Juiciness et Game Feel : Coder des animations pour des \xe9l\xe9ments de game feel et de juiciness (c\xe2bles sur les c\xf4t\xe9s qui augmentent en opacit\xe9 quand le monstre est proche)","Programmation de la d\xe9faite : faire un event quand le monstre a touch\xe9 le joueur, ce qui signifie la fin de jeu, mettre une image de screamer avec un son. Et mettre des variables changeables pour les game designersMode easter egg (G\xe9n\xe9rateurs, QTE sur les g\xe9n\xe9rateurs, porte de sortie)","Communication permanente avec les Game Programmers pour avancer rapidement et poser des questions. Et communication avec les game Designer pour savoir pr\xe9cis\xe9ment les m\xe9caniques et comportements des IA"],h),"Tasks-EN",A.a(["Programming of AI with States (different behaviors) and Pathfinding A*. Programming of 3 AI with each different behaviors","Juiciness and Game Feel: Code animations for game feel and juiciness elements (cables on the sides that increase in opacity when the monster is close)","Defeat: make an event when the monster has touched the player, which means the end of the game, put a screamer image with a sound. And put changeable variables for game designers","Easter egg mode (Generators, QTE on generators, exit door)","Constant communication with Game Programmers to move forward quickly and ask questions. And communication with game Designers to know precisely the mechanics and behaviors of the AI"],h),q,"En tant que Gameplay Programmer, je devais d\xe9velopper les IA du jeu avec diff\xe9rent comportements, de s'assurer de l'avanc\xe9 de chacun c\xf4t\xe9 technique et gameplay, du d\xe9veloppement d'un mod bonus, du gamefeel (visuel et audio).",p,"As a Gameplay Programmer, I had to develop the AI of the game with different behaviors, to ensure the progress of each one on the technical and gameplay side, to develop a bonus mod, the gamefeel (visual and audio).","NumPersonnes",11,"NumSemaines",1,"Location",m,"Importance",0,"Image","./assets/GamesPhotos/dontlookaway.png","Story-EN","You are almost at the end of your medical school, and you receive a letter. \n A hospital makes you a proposal. They give you a try as an intern. \n After you accept it, you go to the site. Then you wake up in a room without any light, with, lucky for you, a flashlight. \n The only thing you remember is you, arriving at the hospital, opening the door with a keycard that's no longer in your possession.  \n With one voice resonating in your mind : \n \"Whatever happens, don't look away\"...","Story-FR","Vous \xeates presque \xe0 la fin de votre \xe9cole de m\xe9decine, et vous recevez une lettre. \n Un h\xf4pital vous fait une proposition. Ils vous donnent un essai en tant que stagiaire. \n Apr\xe8s l'avoir accept\xe9, vous vous rendez sur le site. Puis vous vous r\xe9veillez dans une pi\xe8ce sans aucune lumi\xe8re, avec, chance pour vous, une lampe torche. \n La seule chose dont vous vous souvenez est vous, arrivant \xe0 l'h\xf4pital, ouvrant la porte avec une carte magn\xe9tique qui n'est plus en votre possession.  \n Avec une voix r\xe9sonnant dans votre esprit : \n \"Quoi qu'il arrive, ne d\xe9tournez pas le regard\"...","LinkItchIo","https://tos927.itch.io/don-t-look-away","ItchIoEmbed",'<iframe frameborder="0" src="https://itch.io/embed/2962966" width="552" height="167"><a href="https://tos927.itch.io/don-t-look-away">Don\'t Look Away by Tos927, arachide, Cesar_123, Kanoshitv, Kyoteki, Xiiao, charliebrv, eleanoretht, CookieKrips</a></iframe>'],g,f),"Dreamstrike",A.S(["Key","Dreamstrike","Name","Dreamstrike","Job",o,"Skills",A.a(["Godot","GDScript"],h),"GameType",A.a(["Shooter"],h),p,n,q,"En tant que Lead Game Developper, j'\xe9tais en charge des questions techniques, des d\xe9lais dans toute l'\xe9quipe, de la faisabilit\xe9 technique et de l'avancement de mes propres t\xe2ches.","NumPersonnes",5,"NumSemaines",2,"Location","Gaming Campus","Importance",1,"Image","./assets/GamesPhotos/dreamstrike.png","Story-EN","Dreamstrike is a top view shooter in which you play as a crow crossing a dream world. You will have to defeat bosses in story mode or in endless mode, go as far as possible !","Story-FR","Dreamstrike est un shooter top view dans lequel vous incarnez un corbeau traversant un monde de r\xeave. Vous devrez vaincre des boss dans le mode histoire ou alors dans le mode infini, aller le plus loin possible !","LinkItchIo","https://cookiekrips.itch.io/dreamstrike","ItchIoEmbed",' <iframe frameborder="0" src="https://itch.io/embed/2023448" width="552" height="167"><a href="https://cookiekrips.itch.io/dreamstrike">Dreamstrike : the oniric odyssey by CookieKrips</a></iframe> ',"Images",A.a(["assets/Dreamstrike/1.png","assets/Dreamstrike/2.png","assets/Dreamstrike/3.png"],h),"Trailer","assets/Dreamstrike/Trailer.mp4"],g,f),"HeadsOut",A.S(["Key","HeadsOut","Name","Heads Out","Job",l,"Skills",A.a(["Unreal Engine","Blueprint"],h),"GameType",A.a(["Horror"],h),"Tasks-FR",[],q,"En tant que Gameplay Programmer, je devais : d\xe9velopper des mini-jeu, des effets visuels pour le gamefeel, l'int\xe9gration des sons dans les mini-jeu et de l'environnement, communiquer constamment avec les game designers pour l'\xe9quilibrage des mini-jeu et des m\xe9caniques.",p,"As a Gameplay Programmer, I had to : develop mini-games, visual effects for the gamefeel, integrate sounds into mini-games and the environment, constantly communicate with game designers for balancing mini-games and mechanics.","NumPersonnes",11,"NumSemaines",1,"Location",m,"Importance",0,"Image","./assets/GamesPhotos/headsout.png","Story-EN","Heads of SCP is an horrific experience in which you will be locked in a room with SCP-569, a swarm of flying and unpredictable heads. Your goal is to escape from this funny place. However, the Heads will not let you pass so easily. To progress, you will have to understand and execute their requests, under penalty of being stopped by them.","Story-FR","Heads of SCP est une exp\xe9rience horrifique dans laquelle vous serez enferm\xe9 dans une pi\xe8ce avec SCP-569, une nu\xe9e de t\xeates volantes et impr\xe9visibles. Votre objectif est de vous \xe9chapper de ce dr\xf4le d'endroit. Cependant, les T\xeates ne vous laisseront pas passer si facilement. Pour progresser, vous devrez comprendre et ex\xe9cuter leurs demandes, sous peine d\u2019\xeatre arr\xeat\xe9 par elles.","LinkItchIo","https://weajen.itch.io/headsofscp","ItchIoEmbed",' <iframe frameborder="0" src="https://itch.io/embed/3009986" width="552" height="167"><a href="https://weajen.itch.io/headsofscp">Heads out by Weajen</a></iframe> ',"LinkTrailer","https://drive.google.com/file/d/14qSxy-se-T2VDpoGyWe3i3p1Mmt8VsgP/view?usp=sharing"],g,f),"MusicBotDiscord",A.S(["Key","MusicBotDiscord","Name","CookieJam","Job","Discord Bot Developper","Skills",A.a(["Python","Discord"],h),"GameType",A.a(["Discord Bot","Music"],h),"Tasks-FR",A.a(["Comprendre comment utiliser des API, celle de discord en particulier","Faire des requ\xeates api pour r\xe9cuperer les vid\xe9os youtubes","Des commandes pour que les utilisateurs puissent jouer, skip de la musique et une commande pour faire quitter le bot","Utiliser FMOD pour pouvoir jouer du son"],h),"Tasks-EN",A.a(["Understand how APIs works, and in particular the one of discord","Use api queries to retrieve youtube videos","Commands for users to play, skip music and a command to kick the bot","Use FMOD to be able to play some sounds"],h),"NumPersonnes",1,"NumSemaines",1,"Importance",1,"Story-EN","CookieJam is a discord bot to play music on your server ! Just type /play and the name of the music you want to play, and the bot will join your voice channel and play the music ! \n I created it because a friend couldn't find a good music bot for her server, so I decided to create one for her.","Story-FR","CookieJam est un bot discord pour jouer de la musique sur votre serveur ! Tapez simplement /play et le nom de la musique que vous voulez jouer, et le bot rejoindra votre salon vocal et jouera la musique ! \n J'ai cr\xe9\xe9 ce bot musique car une amie ne trouvait pas de bon bot musique pour son serveur, j'ai donc d\xe9cid\xe9 d'en cr\xe9er un pour elle.","Image","./assets/logo.png"],g,f),"Beam",A.S(["Key","Beam","Name","Beam!","Job",l,"Skills",A.a(["Unreal Engine","Blueprint","C++"],h),"GameType",A.a(["Little Fight"],h),"NumPersonnes",8,"NumSemaines",12,"Location",m,"Importance",0],g,f),"NoteApp",A.S(["Key","NoteApp","Name","Note App","Job","App Developper","Skills",A.a(["Godot","GDScript"],h),"GameType",A.a(["App","Note"],h),"Tasks-FR",A.a(["D\xe9couvrir android studio pour pouvoir avoir l'application sur le t\xe9l\xe9phone","Trouver un format de fichier appropri\xe9 entre le md, json, txt (choisit le json)","Apprendre comment faire de l'UI sur Godot avec les nodes control","Faire de la save de fichier pour le txt (avant d'\xeatre pass\xe9 au json j'avais prit le txt comme format)","Coder les diff\xe9rentes pages (Note, Home)"],h),"Tasks-EN",A.a(["Explore Android Studio to run the application on a mobile phone","Choose an appropriate file format among md, json, txt (choose json)","Learn how to create UI in Godot using Control nodes","Implement file saving for txt format (initially chosen before switching to json)","Code the different pages (Note, Home)"],h),"NumPersonnes",1,"NumSemaines",1,"Importance",2,"Story-EN",'NoteIt is an app to note down some things you want to remember ! Simple to use, just click "New note" to create a new note or click on an already existing note to change it !',"Story-FR",'NoteIt est une applicaiton pour noter des choses que vous voulez vous rappeler ! Simple \xe0 utiliser, cliquez simplement sur "Nouvelle note" pour cr\xe9er une nouvelle note ou cliquez sur une note d\xe9j\xe0 existante pour la modifier !',"Features",A.a(["Create a new note","Edit a note","Delete a note","Save notes","Load notes"],h),"LinkItchIo","https://cookiekrips.itch.io/noteit","ItchIoEmbed",' <iframe frameborder="0" src="https://itch.io/embed/2367193" width="552" height="167"><a href="https://cookiekrips.itch.io/noteit">NoteIt by CookieKrips</a></iframe> ',"Images",A.a([k,"assets/NoteIt/2.png","assets/NoteIt/3.png"],h),"Image",k],g,f),"PokemonLike",A.S(["Key","PokemonLike","Name","Pokemon Like","Job","Game Developper","Tasks-FR",A.a(["Coder les classes des pok\xe9mons (avec les vrais formules de calculs de stats)","Syst\xe8me de dialogue","Shader (Changer les couleurs des cheveux des pnj avec le shader)","Pnj (Dialogue, donner des objets, combat)","D\xe9placement par tuiles du joueur"],h),"Tasks-EN",A.a(["Code Pokemon classes (using the actual formulas for calculating stats)","Implement a dialogue system","Create a shader (to change NPC hair colors with the shader)","NPC interactions: dialogues, item giving, battles","Tile-based player movement"],h),"Story-FR","Pokemon Like est un jeu qui s'inspire de pokemon, un tour par tour, rpg. Con\xe7u sur l'id\xe9e de game design d'un youtubeur qui se posait la question de comment faire pokemon mais en plus int\xe9r\xe9ssant. J'ai donc d\xe9cid\xe9 d'essayer de faire un d\xe9but de jeu pokemon pour d\xe9couvrir toutes les complexit\xe9s que ce jeu offre","Story-EN","Pokemon Like is a game that inspires itself from the pokemon games, turn based, rpg. Based on a game design idea of a youtuber, that was asking himself how to make a more interesting pokemon game. So I decided to try to make the start of a pokemon game to discover all the complexs things these games have to offer","Skills",A.a(["Godot","GDScript","Shader"],h),"GameType",A.a(["Pokemon","Turn-Based"],h),"NumPersonnes",1,"NumSemaines",2,"Importance",1,"Image",j,"Images",A.a([j,"assets/PokemonLike/2.JPG","assets/PokemonLike/3.JPG"],h)],g,f),"ZeldaLike",A.S(["Key","ZeldaLike","Name","Zelda Like","Job","Game Developper","Skills",A.a(["Godot","GDScript"],h),"GameType",A.a(["Zelda","Adventure"],h),"NumPersonnes",1,"NumSemaines",4,"Importance",1,q,"En tant que Game Developper dans ce projet, je devais r\xe9flechir au game design et gameplay du jeu. Les assets \xe9taient d\xe9j\xe0 trouv\xe9s sur itch.io. J'ai d\xfb donc avoir les 2 casquettes, Game developper et Game designer, ce qui f\xfbt un challenge. Je devais donc faire le game design du jeu et en m\xeame temps travailler sur le gameplay",p,"As a Game Developper in this project, I had to think about the game design and gameplay of the game. The assets were already found on itch.io. So I had to have the 2 caps, Game developper and Game designer, which was a challenge. I had to make the game design of the game and at the same time work on the gameplay","Tasks-FR",A.a(["R\xe9fl\xe9chir aux m\xe9caniques de jeu (Zelda Like)","Penser aux mmonstres \xe0 faire","R\xe9fl\xe9chir aux Boss \xe0 faire (des boss avec 3 phases et un pattern principal)","Le level design (Les villages)","L'histoire au global (Le joueur doit sauver le monde de la destruction par exemple)","Coder les m\xe9caniques pour le joueur (Le joueur peut attaquer, se d\xe9placer, parler aux PNJ)","Faire des PNJ avec des dialogues","Programmer le boss avec 3 phases et un pattern principal","Coder des phases de dialogues avec des actions des PNJ (Comme dans pokemon par exemple)","Faire les ennemies (Monstre qui tire des boules de feu, monstre qui charge le joueur)"],h),"Tasks-EN",A.a(["Think about the game mechanics (Zelda Like)","Think about the monsters to make","Think about the Boss to make (boss with 3 phases and a main pattern)","The level design (The villages)","The story as a whole (The player must save the world from destruction for example)","Code the mechanics for the player (The player can attack, move, talk to NPCs)","Make NPCs with dialogues","Program the boss with 3 phases and a main pattern","Code dialogue phases with NPC actions (Like in pokemon for example)","Make the enemies (Monster that shoots fireballs, monster that charges the player)"],h),"TipsLearned-FR",A.a(["Ne pas s'eparpiller partout (faire plusieurs Boss et des villes alors que le gameplay de base n'est pas finit)","Faire une boucle de gameplay simple pour un prototype","Ne pas voir trop grand (essayer de faire plusieurs Boss / Villages alors que c'est le d\xe9but du projet)\xcatre Game Developper et Game Designer est un challenge","\xcatre un developpeur solo est un challenge"],h),"TipsLearned-EN",A.a(["Don't scatter everywhere (make several Bosses and cities while the basic gameplay isn't finished)","Make a simple gameplay loop for a prototype","Don't see too big (try to make several Bosses / Villages while it's the beginning of the project)Being a Game Developper and Game Designer is a challenge","Being a solo developer is a challenge too"],h),"Images",A.a(["assets/ZeldaLike/1.png","assets/ZeldaLike/2.png",i],h),"Videos",A.a(["assets/ZeldaLike/Video1.mp4","assets/ZeldaLike/Video2.mp4"],h),"Image",i],g,f),"Evoascii",A.S(["Key","Evoascii","Name","Evoascii","Job","Game Developper","Skills",A.a(["C#"],h),"GameType",A.a(["Evolution","Pokemon","Turn-Based"],h),"NumPersonnes",3,"NumSemaines",2,"Importance",2],g,f)],g,t.a)})
